"use client";
import React, { useState, useEffect } from "react";
import { useRouter } from "next/navigation";
import { ClienteForm } from "@/modules/clientes/ui/ClienteForm";
import { ClienteCreateInput, ClienteUpdateInput } from "@/types/cliente";
import { Panel } from "@/components/GladPros";
import { useToast } from "@/components/ui/Toaster";

interface EditClientePageProps {
  params: { id: string } | Promise<{ id: string }>;
}

export default function DetailPage({ params }: EditClientePageProps) {
  // extrai id de forma segura
  const resolvedParams = (params as { id: string }) || { id: '' };
  const id = typeof resolvedParams === 'object' && 'id' in resolvedParams ? resolvedParams.id : '';
  const router = useRouter();
  const { showToast } = useToast();
  const [cliente, setCliente] = useState<Record<string, unknown> | null>(null);
  const [loading, setLoading] = useState(true);
  const [operationLoading, setOperationLoading] = useState(false);

  useEffect(() => {
    let cancelled = false;
    const fetchCliente = async () => {
      try {
        const response = await fetch(`/api/clientes/${id}`);
        if (!response.ok) {
          throw new Error('Cliente não encontrado');
        }
    const data = await response.json();
  if (!cancelled) setCliente(data as Record<string, unknown>);
      } catch (error: unknown) {
        if (cancelled) return;
        console.error('Erro ao carregar cliente:', error);
        const msg = (error as { message?: string })?.message ?? String(error);
        showToast({ title: 'Erro', message: msg || 'Erro ao carregar cliente', type: 'error' });
        router.push('/clientes');
      } finally {
        if (!cancelled) setLoading(false);
      }
    };

    fetchCliente();
    return () => { cancelled = true };
  // include showToast and router in deps because they are stable or intentionally referenced
  // router comes from next/navigation and is safe to include; showToast from context is stable
  }, [id, router, showToast]);

  const handleSubmit = async (data: ClienteCreateInput | ClienteUpdateInput) => {
    setOperationLoading(true);
    try {
      const response = await fetch(`/api/clientes/${id}`, {
        method: 'PUT',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify(data),
      });

      if (!response.ok) {
        const error = await response.json();
        if (error?.details) {
          throw { message: error.error || error.message || 'Dados inválidos', details: error.details };
        }
        const msg: string = error?.error || error?.message || '';
        const fieldErrors: Record<string, string> = {};
        if (/e-mail.*cadastrado|E-mail.*cadastrado/i.test(msg)) fieldErrors.email = msg;
        if (/Documento.*cadastrado/i.test(msg)) {
          const d: any = data;
          if (d?.tipo === 'PJ' && d?.ein) fieldErrors.ein = msg;
          if (d?.tipo === 'PF') {
            if (d?.tipoDocumentoPF === 'SSN' && d?.ssn) fieldErrors.ssn = msg;
            if (d?.tipoDocumentoPF === 'ITIN' && d?.itin) fieldErrors.itin = msg;
          }
        }
        if (Object.keys(fieldErrors).length) throw { message: msg || 'Dados inválidos', fieldErrors };
        throw new Error(msg || 'Erro ao atualizar cliente');
      }

      showToast({ title: 'Sucesso', message: 'Cliente atualizado com sucesso', type: 'success' });
      router.push('/clientes');
    } catch (error: unknown) {
      if ((error as { details?: unknown })?.details) throw error;
      const msg = (error as { message?: string })?.message ?? String(error);
      showToast({ title: 'Erro', message: msg || 'Erro ao atualizar cliente', type: 'error' });
    } finally {
      setOperationLoading(false);
    }
  };

  const handleCancel = () => router.push('/clientes');

  if (loading) {
    return (
      <div className="space-y-4">
        <div className="flex items-center justify-between">
          <h2 className="font-title text-xl">Editar Cliente</h2>
        </div>
        <Panel title="Carregando...">
          <div className="p-6 text-center text-gray-500">Carregando dados do cliente...</div>
        </Panel>
      </div>
    );
  }

  return (
    <div className="space-y-4">
      <div className="flex items-center justify-between">
        <h2 className="font-title text-xl">Editar Cliente</h2>
      </div>

      <Panel title="Editar Cliente">
        <ClienteForm cliente={cliente} onSubmit={handleSubmit} onCancel={handleCancel} loading={operationLoading} />
      </Panel>
    </div>
  );
}

"use client";
import { useState } from "react";
import { useRouter } from "next/navigation";
import { ClienteForm } from "@/modules/clientes/ui/ClienteForm";
import { ClienteCreateInput, ClienteUpdateInput } from "@/types/cliente";
import { Panel } from "@/components/GladPros";
import { useToast } from "@/components/ui/Toaster";

export default function NewPage() {
  const router = useRouter();
  const { showToast } = useToast();
  const [loading, setLoading] = useState(false);

  const handleSubmit = async (data: ClienteCreateInput | ClienteUpdateInput) => {
    setLoading(true);
    try {
      const response = await fetch('/api/clientes', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(data),
      });

      if (!response.ok) {
        const error = await response.json();
        if (error?.details) {
          throw { message: error.error || error.message || 'Dados inválidos', details: error.details };
        }
        const msg: string = error?.error || error?.message || '';
        const fieldErrors: Record<string, string> = {};
        if (/e-mail.*cadastrado|E-mail.*cadastrado/i.test(msg)) {
          fieldErrors.email = msg;
        }
        if (/Documento.*cadastrado/i.test(msg)) {
      const d = data as unknown as Record<string, unknown>;
          if (d?.tipo === 'PJ' && d?.ein) fieldErrors.ein = msg;
          if (d?.tipo === 'PF') {
        if ((d?.tipoDocumentoPF as string) === 'SSN' && (d as any)?.ssn) fieldErrors.ssn = msg;
        if ((d?.tipoDocumentoPF as string) === 'ITIN' && (d as any)?.itin) fieldErrors.itin = msg;
          }
        }
        if (Object.keys(fieldErrors).length) throw { message: msg || 'Dados inválidos', fieldErrors };
        throw new Error(msg || 'Erro ao criar cliente');
      }

      showToast({ title: 'Sucesso', message: 'Cliente criado com sucesso', type: 'success' });
      router.push('/clientes');
    } catch (error: unknown) {
      console.error('Erro ao criar cliente:', error);
      if ((error as { details?: unknown })?.details) throw error;
      const msg = (error as { message?: string })?.message ?? String(error);
      showToast({ title: 'Erro', message: msg || 'Erro ao criar cliente', type: 'error' });
    } finally {
      setLoading(false);
    }
  };

  const handleCancel = () => {
    router.push('/clientes');
  };

  return (
    <div className="space-y-4">
      <Panel title="Novo Cliente">
        <ClienteForm
          onSubmit={handleSubmit}
          onCancel={handleCancel}
          loading={loading}
        />
      </Panel>
    </div>
  );
}
